const routes: Routes = [
  {path: 'respomarche/dashboard', component: DashboardmarcheComponent},
  {
    path: 'expbesoin/edit/:id', 
    component: EditexpbesoinComponent 

  },
];

@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule]
